a','effety@gmail.com','+4179 254 33 21','10:00 AM - 05:00 PM','Urgent',NULL,NULL,'Flynn Wilcox LLC','2024-10-26','0','2024-10-23 11:35:30','2024-10-23 11:35:30','onsite'),(4,161,4,'Residential Nurses','Specialist in general medicine (NL), FMH member In our family doctor\'s practice we are available to you with a wide range of diagnostic and',5,'Fulltime','100k-150k','Zurch','effety@gmail.com','+4179 254 33 21','10:00 AM - 05:00 PM','Urgent',NULL,NULL,'Flynn Wilcox LLC','2024-11-12','0','2024-11-03 12:36:35','2024-11-03 12:36:35','onsite'),(5,3975,3,'test job','Job Summary:\r\nWe are seeking a dedicated and compassionate Medical Assistant to join our growing healthcare team. In this role, you will provide essential support to Dr. Schenker Jean-Martin in delivering high-quality patient care. You will be responsible for a variety of clinical and administrative tasks, ensuring the smooth operation of our practice and enhancing the patient experience.\r\n\r\nKey Responsibilities:\r\n\r\nAssist in patient examinations by preparing examination rooms, obtaining medical histories, and performing basic clinical tasks.\r\nRecord patient information accurately in electronic health records (EHR).\r\nSchedule appointments, manage patient flow, and ensure timely follow-up on test results.\r\nProvide patients with education about their health conditions, treatment options, and wellness strategies.\r\nAdminister medications and vaccines as prescribed by the physician, ensuring compliance with safety protocols.\r\nManage inventory of medical supplies and maintain cleanliness and organization of clinical areas.\r\nPerform administrative duties, including answering phone calls, handling correspondence, and coordinating referrals.\r\nQualifications:\r\n\r\nHigh school diploma or equivalent; completion of a Medical Assistant program is preferred.\r\nCertification as a Medical Assistant (CMA) or equivalent is a plus.\r\nPrevious experience in a medical office or healthcare setting is desirable.\r\nProficient in using electronic health records (EHR) and medical software applications.\r\nExcellent communication skills and a patient-centered approach.\r\nStrong organizational abilities and attention to detail.\r\nWhat We Offer:\r\n\r\nA supportive and collaborative work environment.\r\nOpportunities for professional growth and development.\r\nCompetitive salary and benefits package.\r\nHow to Apply:\r\nInterested candidates are invited to submit their resume and a cover letter outlining their qualifications to [insert email/contact information]. We look forward to welcoming a new member to our dedicated team!',11,'Fulltime','60K-100K','Aigle, Vaud, Switzerland','schenkerjm@gmail.com','+41 79 106 24 24','10.00 -18.00','Urgent',NULL,NULL,'doctomed','2024-11-08','0','2024-11-05 14:03:53','2024-11-05 14:03:53','onsite');
